import React from "react";
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";

const SideMeniu = () => {
  const nav = useNavigate();

  function toPosts() {
    nav("/posts");
  }
  function toGalery() {
    nav("/galey");
  }
  function toProfiles() {
    nav("/profile");
  }

  return (
    <div className="side_meniu">
      <Link onClick={toPosts}>Posts</Link>
      <Link onClick={toGalery}>Galery</Link>
      <Link onClick={toProfiles}>Profile</Link>
    </div>
  );
};

export default SideMeniu;
